module Images
	require 'open-uri'

	def download_go
		errs = []
		images_list_3[:imgList].each_with_index do |img,ind|
			p img[:images]
			saved_image = Image.find_by_cloud_link(img[:images])
			if !saved_image
				img_name = img[:images].to_s.split("/").last
				begin
					read_image = URI.open(img[:images]).read
						File.open("#{Rails.root.join("public", "images")}/#{img_name}", 'wb') do |file|
						file.write read_image
					end
					Image.create(cloud_link: img[:images], file_name: img_name)
				rescue StandardError => e
					errs << img[:images]
				end
			end
		end
		errs
	end	

